"OnePlus kerää luvallasi puhelimen käyttötietoja parantaakseen tuotesuunnittelua ja käyttökokemusta. Jos suostut liittymään käyttökokemusohjelmaan (\"ohjelma\"), tämä ilmoittaa, että hyväksyt, että OnePlus saa kerätä, käyttää ja analysoida seuraavia tietoja: 
 (1) Konfiguraatiotiedot;
 (2) Sovelluksen tilastotiedot;
 (3) Käyttäjän käyttäytymistiedot;
 Keräämällä ja analysoimalla yllä olevat tiedot OnePlus pyrkii parantamaan käyttäjäkokemusta esimerkiksi parantamalla akun tehokkuutta ja järjestelmän vakautta, ja koko menettely tapahtuu nimettömästi ja salatusti suhteessa OnePlussaan. Näitä tietoja ei käytetä henkilöllisyyden tunnistamiseen. Kun olet liittynyt ohjelmaan, voit peruuttaa päätöksesi milloin tahansa seuraavasti: Asetukset – Lisäasetukset – Käyttökokemusohjelma ja poistamalla ruudun valinta. OnePlussan tietosuojakäytännössä on lisätietoja OnePlussan käsittelemistä tiedoista. Kun poistut ohjelmasta, OnePlus lopettaa yllä mainittujen tietojen keräämisen."
